<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Multiple SVGs in HTML</title>
    <style>

      
        
        .logo-container,
        .svg-container {
            position: relative;
            width: 100%;
            height: 200px;
            clear: both;
            margin: 0 auto;
            max-width: 850px;
            text-align: center;
        }
        .svg-container {
          display: flex;
          justify-content: space-between;
        }
        .logo {
          position: relative;  
          top: 50px;
        }
        .svg-container .element-button .border {
          stroke: #F6F6F6; 
        }
        .svg-container .element-button .text {
          fill: #1E1E1E;
        }
        .svg-container .element-button:hover .text {
          fill: #ffffff;
        }

        /* .svg2 {
            bottom: 400px;
            right: 1000px;
        }
        .svg3 {
            bottom: 400px;
            right: 750px;
        }        
        .svg4 {
            bottom: 400px;
            right: 500px;
        }        
        .svg5 {
            bottom: 400px;
            right: 250px;
        } */
        svg.element-button {
          animation: 100ms all;
        }
        svg.element-button:hover {
          cursor: pointer;
        }
        svg.element-button:hover rect.border {
          fill: #000000;
          cursor: pointer;
        }                 
    </style>
</head>
